void reuse()
{
  free_large_pages();
  fast_reuse();
}

void free_large_pages()
{
  Page** current = &header_;
  while (NULL != *current) {
    Page* entry = *current;
    abort_unless(entry->check_magic_code());
    if (is_large_page(entry)) {
      *current = entry->next_page_;
      pages_ -= 1;
      total_ -= entry->raw_size();
      free_page(entry);
      entry = NULL;
    } else {
      tailer_ = *current;
      current = &entry->next_page_;
    }
  }
  if (NULL == header_) {
    tailer_ = NULL;
  }
}

void fast_reuse()
{
  used_ = 0;
  cur_page_ = header_;
  if (NULL != cur_page_) {
    cur_page_->reuse();
  }
  tc_ = nullptr;
}

