inline void reset()
{
  table_id_ = OB_INVALID_ID;
  border_flag_.set_data(0);
  start_key_.assign(NULL, 0);
  end_key_.assign(NULL, 0);
}

inline int reserve(int64_t capacity)
{
  int ret = OB_SUCCESS;
  if (capacity > capacity_) {
    // memory size should be integer times of block_size_
    int64_t new_size = capacity * sizeof(T);
    int64_t plus = new_size % block_size_;
    new_size += (0 == plus) ? 0 : (block_size_ - plus);
    T* new_data = reinterpret_cast<T*>(internal_malloc_(new_size));
    if (OB_NOT_NULL(new_data)) {
      if (is_memcpy_safe()) {
        memcpy(new_data, data_, count_ * sizeof(T));
      } else {
        int64_t fail_pos = -1;
        for (int64_t i = 0; OB_SUCC(ret) && i < count_; i++) {
          if (OB_FAIL(construct_assign(new_data[i], data_[i]))) {
            LIB_LOG(WARN, "failed to copy new_data", K(ret));
            fail_pos = i;
          }
        }
        if (is_destructor_safe()) {
        } else {
          // if construct assign fails, objects that have been copied should be destructed
          if (OB_FAIL(ret)) {
            for (int64_t i = 0; i < fail_pos; i++) {
              new_data[i].~T();
            }
          } else {
            // if construct assign succeeds, old objects in data_ should be destructed
            for (int64_t i = 0; i < count_; i++) {
              data_[i].~T();
            }
          }
        }
      }
      if (OB_SUCC(ret)) {
        if (reinterpret_cast<T*>(local_data_buf_) != data_) {
          internal_free_(data_);
        }
        data_ = new_data;
        capacity_ = new_size / sizeof(T);
      } else {
        // construct_assign fails, free new allocated memory, keep data_'s memory not changed
        // the result is that reserve is not called at all
        internal_free_(new_data);
      }
    } else {
      ret = OB_ALLOCATE_MEMORY_FAILED;
      LIB_LOG(ERROR, "no memory", K(ret), K(new_size), K(block_size_), K(count_), K(capacity_));
    }
  }
  return ret;
}

int ObChunkDatumStore::init(int64_t mem_limit, uint64_t tenant_id /* = common::OB_SERVER_TENANT_ID */,
    int64_t mem_ctx_id /* = common::ObCtxIds::DEFAULT_CTX_ID */,
    const char* label /* = common::ObModIds::OB_SQL_CHUNK_ROW_STORE) */, bool enable_dump /* = true */,
    uint32_t row_extend_size /* = 0 */
)
{
  int ret = OB_SUCCESS;
  enable_dump_ = enable_dump;
  tenant_id_ = tenant_id;
  ctx_id_ = mem_ctx_id;
  label_ = label;
  if (0 == GCONF._chunk_row_store_mem_limit) {
    mem_limit_ = mem_limit;
  } else {
    mem_limit_ = GCONF._chunk_row_store_mem_limit;
  }
  inited_ = true;
  default_block_size_ = BLOCK_SIZE;
  max_blk_size_ = default_block_size_;
  min_blk_size_ = INT64_MAX;
  io_.fd_ = -1;
  row_extend_size_ = row_extend_size;
  return ret;
}

void ObChunkDatumStore::reset()
{
  int ret = OB_SUCCESS;
  if (is_file_open()) {
    aio_write_handle_.reset();
    if (OB_FAIL(FILE_MANAGER_INSTANCE_V2.remove(io_.fd_))) {
      LOG_WARN("remove file failed", K(ret), K_(io_.fd));
    } else {
      LOG_INFO("close file success", K(ret), K_(io_.fd));
    }
    io_.fd_ = -1;
  }
  file_size_ = 0;
  n_block_in_file_ = 0;

  while (!blocks_.is_empty()) {
    Block* item = blocks_.remove_first();
    mem_hold_ -= item->get_buffer()->mem_size();
    mem_used_ -= item->get_buffer()->mem_size();
    if (nullptr != callback_) {
      callback_->free(item->get_buffer()->mem_size());
    }
    if (NULL != item) {
      allocator_->free(item);
    }
  }
  blocks_.reset();
  cur_blk_ = NULL;
  cur_blk_buffer_ = nullptr;
  while (!free_list_.is_empty()) {
    Block* item = free_list_.remove_first();
    mem_hold_ -= item->get_buffer()->mem_size();
    if (nullptr != callback_) {
      callback_->free(item->get_buffer()->mem_size());
    }
    if (NULL != item) {
      allocator_->free(item);
    }
  }

  LOG_DEBUG("mem usage after free", K(mem_hold_), K(mem_used_), K(blocks_.get_size()));
  mem_hold_ = 0;
  mem_used_ = mem_hold_;
  max_blk_size_ = default_block_size_;
  n_blocks_ = 0;
  row_cnt_ = 0;
}

