int init(common::ObIAllocator& allocator, int64_t datum_cnt)
{
  int ret = OB_SUCCESS;
  int64_t buffer_len = datum_cnt * sizeof(ObDatum) + sizeof(T);
  char* buf = nullptr;
  if (NULL != alloc_) {
    ret = common::OB_INIT_TWICE;
    SQL_ENG_LOG(WARN, "init twice", K(ret));
  } else if (OB_ISNULL(buf = reinterpret_cast<char*>(allocator.alloc(buffer_len)))) {
    ret = OB_ALLOCATE_MEMORY_FAILED;
    SQL_ENG_LOG(ERROR, "alloc buf failed", K(ret));
  } else {
    alloc_ = &allocator;
    store_row_ = new (buf) T();
    store_row_->cnt_ = datum_cnt;
    store_row_->row_size_ = datum_cnt * sizeof(ObDatum);
    saved_ = false;
  }
  return ret;
}

int ObBasicNestedLoopJoinOp::get_next_left_row()
{
  if (!get_spec().rescan_params_.empty()) {
    // Reset exec param before get left row, because the exec param still reference
    // to the previous row, when get next left row, it may become wild pointer.
    // The exec parameter may be accessed by the under PX execution by serialization, which
    // serialize whole parameters store.
    ObPhysicalPlanCtx* plan_ctx = GET_PHY_PLAN_CTX(ctx_);
    ParamStore& param_store = plan_ctx->get_param_store_for_update();
    FOREACH_CNT(param, get_spec().rescan_params_)
    {
      param_store.at(param->param_idx_).set_null();
      param->dst_->locate_expr_datum(eval_ctx_).set_null();
    }
  }
  return ObJoinOp::get_next_left_row();
}

int ObJoinOp::get_next_left_row()
{
  int ret = common::OB_SUCCESS;
  left_row_joined_ = false;
  if (OB_FAIL(left_->get_next_row()) && OB_ITER_END != ret) {
    LOG_WARN("fail to get next left row", K(ret));
  }
  return ret;
}

int ObTableScanOp::inner_get_next_row()
{
  int ret = OB_SUCCESS;
  clear_evaluated_flag();
  if (OB_UNLIKELY(is_partition_list_empty_ || 0 == scan_param_.limit_param_.limit_)) {
    ret = OB_ITER_END;
  } else if (iter_end_) {
    ret = OB_ITER_END;
    LOG_DEBUG("inner get next row meet a iter end", K(MY_SPEC.id_), K(this), K(lbt()));
  } else if (OB_ISNULL(result_)) {
    ret = OB_NOT_INIT;
    LOG_WARN("table scan result is not init", K(ret));
  } else if (0 == (++iterated_rows_ % CHECK_STATUS_ROWS_INTERVAL) && OB_FAIL(ctx_.check_status())) {
    LOG_WARN("check physical plan status failed", K(ret));
  } else if (OB_FAIL(get_next_row_with_mode())) {
    if (OB_ITER_END != ret) {
      LOG_WARN("fail to get next row from ObNewRowIterator", K(ret));
    } else {
      if (MY_SPEC.is_top_table_scan_ && (scan_param_.limit_param_.offset_ > 0)) {
        if (output_row_count_ < 0) {
          ret = OB_ERR_UNEXPECTED;
          LOG_WARN("invalid output_row_count_", K(output_row_count_), K(ret));
        } else if (output_row_count_ > 0) {
          int64_t total_count = output_row_count_ + scan_param_.limit_param_.offset_;
          ObPhysicalPlanCtx* plan_ctx = GET_PHY_PLAN_CTX(ctx_);
          NG_TRACE_EXT(found_rows, OB_ID(total_count), total_count, OB_ID(offset), scan_param_.limit_param_.offset_);
          plan_ctx->set_found_rows(total_count);
        }
      }
      if (MY_SPEC.for_update_ && share::is_oracle_mode()) {
        // we get affected rows here now, but we need get it in for_update operator in future.
        ObPhysicalPlanCtx* plan_ctx = GET_PHY_PLAN_CTX(ctx_);
        plan_ctx->set_affected_rows(output_row_count_);
      }
    }
  } else {
    output_row_count_++;
    NG_TRACE_TIMES_WITH_TRACE_ID(1, cur_trace_id_, get_row);
    if (MY_SPEC.is_vt_mapping_ &&
        OB_FAIL(vt_result_converter_->convert_output_row(eval_ctx_, MY_SPEC.mapping_exprs_, MY_SPEC.storage_output_))) {
      LOG_WARN("failed to convert output row", K(ret));
    }
  }
  if (OB_UNLIKELY(OB_ITER_END == ret)) {
    ObIPartitionGroup* partition = NULL;
    ObIPartitionGroupGuard* guard = scan_param_.partition_guard_;
    if (OB_ISNULL(guard)) {
    } else if (OB_ISNULL(partition = guard->get_partition_group())) {
    } else if (scan_param_.main_table_scan_stat_.bf_access_cnt_ > 0) {
      partition->feedback_scan_access_stat(scan_param_);
    }
    ObTableScanStat& table_scan_stat = GET_PHY_PLAN_CTX(ctx_)->get_table_scan_stat();
    fill_table_scan_stat(scan_param_.main_table_scan_stat_, table_scan_stat);
    if (MY_SPEC.should_scan_index() && scan_param_.scan_flag_.index_back_) {
      fill_table_scan_stat(scan_param_.idx_table_scan_stat_, table_scan_stat);
    }
    scan_param_.main_table_scan_stat_.reset_cache_stat();
    scan_param_.idx_table_scan_stat_.reset_cache_stat();
    iter_end_ = true;
  }
  return ret;
}

int ObTableScanOp::get_next_row_with_mode()
{
  int ret = OB_SUCCESS;
  if (MY_SPEC.is_vt_mapping_) {
    // switch to mysql mode
    CompatModeGuard g(ObWorker::CompatMode::MYSQL);
    ret = result_->get_next_row();
  } else {
    ret = result_->get_next_row();
  }
  return ret;
}

int ObTableScanIterator::get_next_row(common::ObNewRow*& row)
{
  int ret = OB_SUCCESS;
  if (NULL == row_iter_) {
    if (OB_FAIL(iter_.get_next_iter(row_iter_))) {
      if (OB_ITER_END != ret) {
        STORAGE_LOG(WARN, "fail to get next iterator", K(ret));
      } else {
        STORAGE_LOG(DEBUG, "table scan iterator reaches end");
      }
    }
  }
  if (OB_SUCC(ret)) {
    if (OB_FAIL(row_iter_->get_next_row(row))) {
      if (OB_ITER_END != ret) {
        STORAGE_LOG(WARN, "fail to get next row", K(ret));
      } else {
        ret = OB_SUCCESS;
        while (OB_SUCC(ret)) {
          if (OB_FAIL(iter_.get_next_iter(row_iter_))) {
            if (OB_ITER_END != ret) {
              STORAGE_LOG(WARN, "fail to get next iter", K(ret));
            } else {
              STORAGE_LOG(DEBUG, "table scan iterator reaches end");
            }
          } else if (OB_FAIL(row_iter_->get_next_row(row))) {
            if (OB_ITER_END != ret) {
              STORAGE_LOG(WARN, "fail to get next row", K(ret));
            } else {
              STORAGE_LOG(DEBUG, "table scan row iterator reaches end");
              ret = OB_SUCCESS;
            }
          } else {
            break;
          }
        }
      }
    }
  }
  return ret;
}

int ObTableScanIterIterator::get_next_iter(common::ObNewRowIterator*& iter)
{
  int ret = OB_SUCCESS;
  if (OB_FAIL(get_next_range())) {
    if (OB_ITER_END != ret) {
      STORAGE_LOG(WARN, "fail to get next range", K(ret));
    }
  } else {
    range_row_iter_.set_range_array_idx(range_array_cursor_);
    iter = &range_row_iter_;
  }
  return ret;
}

int ObTableScanIterIterator::get_next_range()
{
  int ret = OB_SUCCESS;
  if (range_array_cursor_ > range_array_cnt_ || range_array_cursor_ < -1) {
    ret = OB_ITER_END;
  } else {
    range_array_cursor_ = is_reverse_scan_ ? range_array_cursor_ - 1 : range_array_cursor_ + 1;
    ret = range_array_cursor_ >= range_array_cnt_ || range_array_cursor_ < 0 ? OB_ITER_END : OB_SUCCESS;
  }
  return ret;
}

int ObTableScanRangeArrayRowIterator::set_range_array_idx(const int64_t range_array_idx)
{
  int ret = OB_SUCCESS;
  if (OB_FAIL(row_iter_->switch_iterator(range_array_idx))) {
    STORAGE_LOG(WARN, "fail to switch iterator", K(ret), K(range_array_idx));
  } else {
    curr_range_array_idx_ = range_array_idx;
  }
  return ret;
}

int ObTableScanStoreRowIterator::switch_iterator(const int64_t range_array_idx)
{
  int ret = OB_SUCCESS;
  if (nullptr != index_merge_) {
    if (OB_FAIL(index_merge_->switch_iterator(range_array_idx))) {
      STORAGE_LOG(WARN, "fail to switch iterator", K(ret));
    }
  } else {
    if (nullptr != get_merge_) {
      if (OB_FAIL(get_merge_->switch_iterator(range_array_idx))) {
        STORAGE_LOG(WARN, "fail to switch iterator", K(ret));
      }
    } else if (nullptr != multi_scan_merge_) {
      if (OB_FAIL(multi_scan_merge_->switch_iterator(range_array_idx))) {
        STORAGE_LOG(WARN, "fail to switch iterator", K(ret));
      }
    } else if (nullptr != single_merge_) {
      if (OB_FAIL(single_merge_->switch_iterator(range_array_idx))) {
        STORAGE_LOG(WARN, "fail to switch iterator", K(ret));
      }
    } else if (nullptr != scan_merge_) {
      if (OB_FAIL(scan_merge_->switch_iterator(range_array_idx))) {
        STORAGE_LOG(WARN, "fail to switch iterator", K(ret));
      }
    }
    STORAGE_LOG(DEBUG, "switch iterator", K(range_array_idx));
  }
  return ret;
}

int ObMultipleMerge::switch_iterator(const int64_t range_array_idx)
{
  int ret = OB_SUCCESS;
  access_ctx_->range_array_cursor_ = range_array_idx;
  access_ctx_->out_cnt_ = 0;
  STORAGE_LOG(DEBUG, "switch iterator", K(range_array_idx));
  return ret;
}

int ObTableScanRangeArrayRowIterator::get_next_row(common::ObNewRow*& row)
{
  int ret = OB_SUCCESS;
  ObStoreRow* cur_row = NULL;
  if (OB_UNLIKELY(!is_inited_)) {
    ret = OB_NOT_INIT;
    STORAGE_LOG(WARN, "ObTableScanRangeArrayRowIterator has not been inited", K(ret));
  } else if (NULL != cur_row_) {
    cur_row = cur_row_;
  } else {
    if (OB_FAIL(row_iter_->get_next_row(cur_row))) {
      if (OB_ITER_END != ret) {
        STORAGE_LOG(WARN, "fail to get next row", K(ret));
      }
    } else if (OB_ISNULL(cur_row)) {
      ret = OB_ERR_UNEXPECTED;
      STORAGE_LOG(WARN, "curr row must not be NULL", K(ret));
    } else {
      cur_row_ = cur_row;
    }
  }
  if (OB_SUCC(ret)) {
    const int64_t range_array_idx = cur_row->range_array_idx_;
    int comp_ret = static_cast<int32_t>(curr_range_array_idx_ - range_array_idx);
    comp_ret = is_reverse_scan_ ? -comp_ret : comp_ret;
    if (comp_ret > 0) {
      ret = OB_NOT_SUPPORTED;
      STORAGE_LOG(WARN,
          "switch range array when iterator does not reach end is not supported",
          K(ret),
          K(curr_range_array_idx_),
          "curr_row_range_array_idx",
          range_array_idx,
          K_(is_reverse_scan));
    } else if (0 == comp_ret) {
      row = &(cur_row->row_val_);
      cur_row_ = NULL;
      STORAGE_LOG(DEBUG, "get next row", K(*row), K(*cur_row));
    } else if (comp_ret < 0) {
      // curr range is empty
      ret = OB_ITER_END;
      STORAGE_LOG(DEBUG, "get next row iter end", K(curr_range_array_idx_), K(range_array_idx));
    }
  }
  return ret;
}

int ObTableScanStoreRowIterator::get_next_row(ObStoreRow*& cur_row)
{
  int ret = OB_SUCCESS;

  if (OB_UNLIKELY(!is_inited_)) {
    ret = OB_NOT_INIT;
    STORAGE_LOG(WARN, "The ObTableScanStoreRowIterator has not been inited, ", K(ret));
  } else if (OB_ISNULL(main_iter_)) {
    ret = OB_ITER_END;
  } else {
    if (OB_FAIL(main_iter_->get_next_row(cur_row))) {
      if (OB_ARRAY_BINDING_SWITCH_ITERATOR == ret) {
        ret = OB_ITER_END;
      } else if (OB_ITER_END != ret) {
        STORAGE_LOG(WARN, "fail to get next row", K(ret));
      }
    }
  }
  if (OB_SUCC(ret)) {
  } else if (OB_ITER_END != ret) {
    STORAGE_LOG(WARN,
        "Fail to get next row, ",
        K(ret),
        K(*scan_param_),
        K_(main_table_param),
        K_(index_table_param),
        KP(single_merge_),
        KP(get_merge_),
        KP(scan_merge_),
        KP(multi_scan_merge_),
        KP(index_merge_));
  }
  return ret;
}

int ObMultipleMerge::get_next_row(ObStoreRow*& row)
{
  int ret = OB_SUCCESS;
  if (OB_UNLIKELY(!inited_)) {
    ret = OB_NOT_INIT;
    STORAGE_LOG(WARN, "The ObMultipleMerge has not been inited, ", K(ret));
  } else {
    bool filtered = false;
    while (OB_SUCC(ret)) {
      if (access_ctx_->is_end()) {
        ret = OB_ITER_END;
      } else if (nullptr != access_ctx_->limit_param_ && access_ctx_->limit_param_->limit_ >= 0 &&
                 access_ctx_->out_cnt_ - access_ctx_->limit_param_->offset_ >= access_ctx_->limit_param_->limit_) {
        ret = OB_ITER_END;
        access_ctx_->is_end_ = !access_ctx_->is_array_binding_;
        if (access_ctx_->is_array_binding_) {
          if (OB_FAIL(skip_to_range(access_ctx_->range_array_pos_->at(access_ctx_->range_array_cursor_) + 1))) {
            if (OB_ITER_END == ret) {
              access_ctx_->is_end_ = true;
            } else {
              STORAGE_LOG(WARN, "fail to skip range", K(ret));
            }
          } else {
            if (next_row_ != nullptr && next_row_->range_array_idx_ == access_ctx_->range_array_cursor_) {
              next_row_ = nullptr;
            }
            ret = OB_ITER_END;
          }
        }
      } else if (OB_FAIL(refresh_table_on_demand())) {
        STORAGE_LOG(WARN, "fail to refresh table on demand", K(ret));
      } else if (nullptr != next_row_) {
        // reuse the unprojected_row_
      } else if (OB_FAIL(inner_get_next_row(unprojected_row_))) {
        if (OB_ITER_END != ret) {
          STORAGE_LOG(WARN, "Fail to inner get next row, ", K(ret), KP(this));
        } else {
          skip_refresh_table_ = true;
        }
      }

      if (OB_SUCCESS == ret) {
        if (OB_FAIL(check_row_in_current_range(unprojected_row_))) {
          if (OB_ARRAY_BINDING_SWITCH_ITERATOR != ret) {
            STORAGE_LOG(WARN, "fail to check row in current range", K(ret));
          } else {
            next_row_ = &unprojected_row_;
          }
        } else {
          next_row_ = nullptr;
        }
      }

      if (OB_SUCCESS == ret) {
        bool is_filtered = false;
        bool not_using_static_engine =
            (access_param_->output_exprs_ == NULL || access_param_->is_index_back_index_scan());
        if (OB_UNLIKELY(NULL != row_filter_) && OB_FAIL(row_filter_->check(unprojected_row_, is_filtered))) {
          STORAGE_LOG(WARN, "filter row failed", K(ret), K(unprojected_row_));
        } else if (is_filtered) {
          STORAGE_LOG(DEBUG, "store row is filtered", K(unprojected_row_));
          ++filt_cnt_;
        } else if (OB_FAIL((not_using_static_engine) ? project_row(unprojected_row_,
                                                           access_param_->iter_param_.out_cols_project_,
                                                           range_idx_delta_,
                                                           cur_row_)
                                                     : project2output_exprs(unprojected_row_, cur_row_))) {
          STORAGE_LOG(WARN, "fail to project row", K(ret));
        } else if (need_fill_default_ && nop_pos_.count() > 0 && OB_FAIL(fuse_default(cur_row_.row_val_))) {
          STORAGE_LOG(WARN, "Fail to fuse default row, ", K(ret));
        } else if (!need_fill_default_ && !need_output_row_with_nop_ && nop_pos_.count() > 0) {
          // this is for sample scan on increment data, we only output one row if increment data
          // has all the column data needed by the sample scan
          continue;
        } else if (need_padding_ && OB_FAIL(pad_columns(cur_row_.row_val_))) {
          STORAGE_LOG(WARN, "Fail to padding columns, ", K(ret));
        } else if (need_fill_virtual_columns_ && OB_FAIL(fill_virtual_columns(cur_row_.row_val_))) {
          STORAGE_LOG(WARN, "Fail to fill virtual columns, ", K(ret));
          // new static type engine, obj is converted to datum, but no meta is used any more, so do not fill scale here
        } else if (not_using_static_engine && access_param_->need_fill_scale_ &&
                   OB_FAIL(fill_scale(cur_row_.row_val_))) {
          STORAGE_LOG(WARN, "Fail to fill scale", K(ret));
          // fill_lob_locator need to finish before check_filtered, because:
          // The new expression parameters in new engine is lob locator type, while the expected
          // parameters may not be lob locator, thus can do a implicit cast here.
          // If fill_lob_locator hasn't completed during computing filter condition,
          // the implicit cast can cause problem.
        } else if (not_using_static_engine && OB_UNLIKELY(nullptr != access_ctx_->lob_locator_helper_)) {
          if (!access_ctx_->lob_locator_helper_->is_valid()) {
            ret = OB_ERR_UNEXPECTED;
            STORAGE_LOG(WARN, "Unexpected lob locator helper", K(ret), KPC(access_ctx_->lob_locator_helper_));
          } else if (OB_FAIL(
                         access_ctx_->lob_locator_helper_->fill_lob_locator(cur_row_.row_val_, true, *access_param_))) {
            STORAGE_LOG(WARN, "Failed to fill row with lob locator", K(ret));
          }
        }
        if (OB_FAIL(ret) || is_filtered) {
        } else if (unprojected_row_.fast_filter_skipped_) {
          filtered = false;
          unprojected_row_.fast_filter_skipped_ = false;
        } else if (OB_FAIL(check_filtered(cur_row_.row_val_, filtered))) {
          STORAGE_LOG(WARN, "fail to check row filtered", K(ret));
        }

        if (OB_FAIL(ret)) {
        } else if (filtered) {
          ++filt_cnt_;
          row = NULL;
        } else {
          row = &cur_row_;
        }
        if (NULL != access_ctx_->table_scan_stat_) {
          access_ctx_->table_scan_stat_->access_row_cnt_++;
        }
      }

      // check row
      if (OB_SUCC(ret) && nullptr != row) {
        bool out = false;
        if (nullptr != access_ctx_->limit_param_) {
          if (access_ctx_->out_cnt_ < access_ctx_->limit_param_->offset_) {
            if (NULL != access_param_->op_) {
              // clear evaluated flag for next row.
              access_param_->op_->clear_evaluated_flag();
            }
            out = false;
          } else {
            out = true;
          }
        } else {
          out = true;
        }
        ++access_ctx_->out_cnt_;
        if (out) {
          break;
        }
      }
    }

    if (OB_ITER_END == ret) {
      EVENT_ADD(STORAGE_READ_ROW_COUNT, scan_cnt_);
      if (NULL != access_ctx_->table_scan_stat_) {
        access_ctx_->table_scan_stat_->access_row_cnt_ += row_stat_.filt_del_count_;
        table_stat_.access_row_cnt_ += row_stat_.filt_del_count_;
        access_ctx_->table_scan_stat_->rowkey_prefix_ = access_ctx_->access_stat_.rowkey_prefix_;
        access_ctx_->table_scan_stat_->bf_filter_cnt_ += access_ctx_->access_stat_.bf_filter_cnt_;
        access_ctx_->table_scan_stat_->bf_access_cnt_ += access_ctx_->access_stat_.bf_access_cnt_;
        access_ctx_->table_scan_stat_->empty_read_cnt_ += access_ctx_->access_stat_.empty_read_cnt_;
        access_ctx_->table_scan_stat_->fuse_row_cache_hit_cnt_ += table_stat_.fuse_row_cache_hit_cnt_;
        access_ctx_->table_scan_stat_->fuse_row_cache_miss_cnt_ += table_stat_.fuse_row_cache_miss_cnt_;
        access_ctx_->table_scan_stat_->block_cache_hit_cnt_ += access_ctx_->access_stat_.block_cache_hit_cnt_;
        access_ctx_->table_scan_stat_->block_cache_miss_cnt_ += access_ctx_->access_stat_.block_cache_miss_cnt_;
        access_ctx_->table_scan_stat_->row_cache_hit_cnt_ += access_ctx_->access_stat_.row_cache_hit_cnt_;
        access_ctx_->table_scan_stat_->row_cache_miss_cnt_ += access_ctx_->access_stat_.row_cache_miss_cnt_;
      }
      report_table_store_stat();
    }
    if (OB_SUCC(ret)) {
      if (NULL != access_ctx_->table_scan_stat_) {
        access_ctx_->table_scan_stat_->out_row_cnt_++;
      }
    }
  }
  return ret;
}

int ObChunkDatumStore::add_row(const common::ObIArray<ObExpr*>& exprs, ObEvalCtx* ctx, StoredRow** stored_row)
{
  int ret = OB_SUCCESS;
  if (!is_inited()) {
    ret = OB_NOT_INIT;
    LOG_WARN("not init", K(ret));
  } else {
    if (NULL == cur_blk_) {
      int64_t min_buf_size = 0;
      Block* new_blk = nullptr;
      if (OB_FAIL(Block::min_buf_size(exprs, *ctx, min_buf_size))) {
      } else if (OB_FAIL(alloc_block_buffer(new_blk, min_buf_size, false))) {
        LOG_WARN("alloc block failed", K(ret));
      } else {
        use_block(new_blk);
        blocks_.add_last(cur_blk_);
        n_blocks_++;
      }
    }
    if (OB_SUCC(ret)) {
      if (OB_FAIL(cur_blk_->append_row(exprs, ctx, cur_blk_buffer_, row_extend_size_, stored_row))) {
        if (OB_BUF_NOT_ENOUGH == ret) {
          int64_t min_buf_size = 0;
          if (OB_FAIL(Block::min_buf_size(exprs, *ctx, min_buf_size))) {
          } else if (OB_FAIL(switch_block(min_buf_size))) {
            if (OB_EXCEED_MEM_LIMIT != ret) {
              LOG_WARN("switch block failed", K(ret));
            }
          } else if (OB_FAIL(cur_blk_->append_row(exprs, ctx, cur_blk_buffer_, row_extend_size_, stored_row))) {
          } else {
            row_cnt_++;
            if (OB_UNLIKELY(0 > col_count_)) {
              col_count_ = exprs.count();
            }
          }
        } else {
          LOG_WARN("add row to block failed", K(ret));
        }
      } else {
        row_cnt_++;
        if (OB_UNLIKELY(0 > col_count_)) {
          col_count_ = exprs.count();
        }
      }
    }
  }
  return ret;
}

int ObBasicNestedLoopJoinOp::prepare_rescan_params(bool is_group)
{
  int ret = OB_SUCCESS;
  int64_t param_cnt = get_spec().rescan_params_.count();
  for (int64_t i = 0; OB_SUCC(ret) && i < param_cnt; ++i) {
    const ObDynamicParamSetter& rescan_param = get_spec().rescan_params_.at(i);
    if (OB_FAIL(rescan_param.set_dynamic_param(eval_ctx_))) {
      LOG_WARN("fail to set dynamic param", K(ret));
    }
  }

  if (OB_SUCC(ret) && get_spec().enable_gi_partition_pruning_) {
    ObDatum* datum = nullptr;
    if (OB_FAIL(get_spec().gi_partition_id_expr_->eval(eval_ctx_, datum))) {
      LOG_WARN("fail eval value", K(ret));
    } else {
      int64_t part_id = datum->get_int();
      ctx_.get_gi_pruning_info().set_part_id(part_id);
    }
  }

  if (OB_SUCC(ret) && !is_group) {
    if (OB_FAIL(open_right_child())) {
      LOG_WARN("failed to open right child", K(ret));
    }
  }

  return ret;
}

int ObTableScanOp::group_add_query_range()
{
  int ret = OB_SUCCESS;
  if (OB_FAIL(prepare(true))) {  // prepare scan input param
    LOG_WARN("fail to prepare scan param", K(ret));
  } else if (OB_FAIL(append(scan_param_.key_ranges_, MY_INPUT.key_ranges_))) {
    LOG_WARN("failed to append key ranges", K(ret));
  } else if (OB_FAIL(scan_param_.range_array_pos_.push_back(scan_param_.key_ranges_.count() - 1))) {
    LOG_WARN("failed to push back range array pos", K(ret));
  } else {
    LOG_DEBUG("group add query range", K(MY_INPUT.key_ranges_), K(scan_param_.range_array_pos_));
  }
  return ret;
}

int ObTableScanOp::group_rescan()
{
  int ret = OB_SUCCESS;
  if (OB_UNLIKELY(is_virtual_table(MY_SPEC.ref_table_id_) || MY_SPEC.for_update_)) {
    ret = OB_ERR_UNEXPECTED;
    LOG_WARN("failed to perform table scan for update or on virtual table", K(ret));
  } else if (OB_FAIL(ObOperator::rescan())) {
    LOG_WARN("rescan operator failed", K(ret));
  } else if (OB_INVALID_INDEX == MY_INPUT.get_location_idx()) {
    iter_end_ = true;
    LOG_DEBUG("this a mock table scan", K(ret), K(MY_INPUT.get_location_idx()));
  } else if (OB_ISNULL(bnl_iters_)) {
    ret = OB_ERR_UNEXPECTED;
    LOG_ERROR("bnl_iters_ is NULL", K(ret));
  } else if (MY_SPEC.is_vt_mapping_ && OB_FAIL(vt_result_converter_->convert_key_ranges(scan_param_.key_ranges_))) {
    LOG_WARN("failed to convert key ranges", K(ret));
  } else if (OB_FAIL(static_cast<ObTableScanIterIterator*>(bnl_iters_)->rescan(scan_param_))) {
    LOG_WARN("failed to rescan", K(ret), K(scan_param_));
  } else if (OB_FAIL(bnl_iters_->get_next_iter(result_))) {
    LOG_WARN("failed to get next iter", K(ret));
  } else if (OB_ISNULL(result_)) {
    ret = OB_ERR_UNEXPECTED;
    LOG_WARN("get unexpected null", K(result_), K(ret));
  } else {
    iter_end_ = false;
  }
  return ret;
}

int ObChunkDatumStore::Iterator::get_next_row(
    const common::ObIArray<ObExpr*>& exprs, ObEvalCtx& ctx, const StoredRow** sr /*NULL*/)
{
  int ret = OB_SUCCESS;
  const StoredRow* tmp_sr = NULL;
  if (OB_FAIL(get_next_row(tmp_sr))) {
    if (OB_ITER_END != ret) {
      LOG_WARN("get next stored row failed", K(ret));
    }
  } else if (OB_FAIL(convert_to_row(tmp_sr, exprs, ctx))) {
    LOG_WARN("convert row failed", K(ret), K_(chunk_it), K_(row_it));
  } else if (NULL != sr) {
    *sr = tmp_sr;
  }
  return ret;
}
